define(['uiComponent','Magento_Customer/js/customer-data','underscore'],function(Component,customerData,_){'use strict';return Component.extend({defaults:{isShowAddToCart:false},initialize:function(){this._super();this.lastOrderedItems=customerData.get('last-ordered-items');this.lastOrderedItems.subscribe(this.checkSalableItems.bind(this));this.checkSalableItems();return this;},initObservable:function(){this._super().observe('isShowAddToCart');return this;},checkSalableItems:function(){var isShowAddToCart=_.some(this.lastOrderedItems().items,{'is_saleable':true});this.isShowAddToCart(isShowAddToCart);}});});